package com.apple;
import com.apple.test.GenerateHMACToken;

class GetInputRequest
{
 def log
 def context
 def testRunner
 def inputData
 def obj
 // Class constructor with same case as Class name
 def GetInputRequest(logIn,contextIn,testRunnerIn)
 {
    this.log = logIn
    this.context = contextIn
    this.testRunner = testRunnerIn
 }

  def execute(message)
  {
         // do some stuff to prove I've run with right context, etc.
         log.info testRunner
         log.info context
         log.info "return "+message
         return message
  }

  def getInputData(testRunner)
  {

  	def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)

	//def projectPath = groovyUtils.projectPath

	def projectPath = "/Users/Rama_Repala/Documents/SoapUITest/IRepairServicesTestSuite"



	log.info "projectPath" + projectPath

	def folderName = projectPath +"/"+ testRunner.testCase.name

	log.info folderName

	def row = testRunner.testCase.testSteps["DataSource"].currentRow

	def allFiles = []
	new File( folderName ).eachFile() 
	{ 
		file ->
  		if( file.name =~ /.json/ )
  		{
    	 	allFiles.add( file.name )  
    	}
  	}

	if ( (row + 1) <= allFiles.size )
	{
  		// output to the TestStep property called inputData
  		inputData = new File( folderName + "/" + allFiles[row] ).text
	}
	return inputData

  }

  def getTimeStamp()
  {

  	obj = new GenerateHMACToken()

	String ts = obj.getTZDateToString("GMT",new Date(),"yyyy-MM-dd-HH.mm.ss.SSSSSS")

	log.info "timestamp for ts:"+ts

	return ts
  }

  def getAuthToken(personid,timestamp)
  {

	obj = new GenerateHMACToken()
	def val = obj.generateHMACDigest(personid, timestamp)
	log.info val
	return val
  }

  def getPersonID()
  {
  	return "221598719"
  }

}


